import React from 'react';

const AdminDashboard = () => {
  return (
    <div
      style={{
        display: 'flex',
        flexDirection: 'column',
        height: '100vh',
        backgroundColor: '#f0f0f0',
      }}
    >
      <header
        style={{
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
          padding: '1rem 2rem',
          backgroundColor: '#fff',
          boxShadow: '0 2px 8px rgba(0, 0, 0, 0.1)',
        }}
      >
        <h1 style={{ color: '#333', fontSize: '1.5rem' }}>Book Rent Admin</h1>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <span style={{ marginRight: '1rem', color: '#666' }}>Hello, Admin</span>
          <button
            style={{
              padding: '0.5rem 1rem',
              backgroundColor: '#007bff',
              color: '#fff',
              border: 'none',
              borderRadius: '4px',
              fontSize: '1rem',
              cursor: 'pointer',
            }}
          >
            Logout
          </button>
        </div>
      </header>

      <div
        style={{
          display: 'flex',
          flexGrow: 1,
        }}
      >
        <nav
          style={{
            width: '200px',
            backgroundColor: '#333',
            padding: '2rem 1rem',
          }}
        >
          <ul
            style={{
              listStyle: 'none',
              padding: 0,
              margin: 0,
            }}
          >
            <li
              style={{
                marginBottom: '1rem',
              }}
            >
              <a
                href="#"
                style={{
                  color: '#fff',
                  textDecoration: 'none',
                  fontSize: '1.1rem',
                }}
              >
                Dashboard
              </a>
            </li>
            <li
              style={{
                marginBottom: '1rem',
              }}
            >
              <a
                href="#"
                style={{
                  color: '#fff',
                  textDecoration: 'none',
                  fontSize: '1.1rem',
                }}
              >
                Books
              </a>
            </li>
            <li
              style={{
                marginBottom: '1rem',
              }}
            >
              <a
                href="#"
                style={{
                  color: '#fff',
                  textDecoration: 'none',
                  fontSize: '1.1rem',
                }}
              >
                Users
              </a>
            </li>
            <li
              style={{
                marginBottom: '1rem',
              }}
            >
              <a
                href="#"
                style={{
                  color: '#fff',
                  textDecoration: 'none',
                  fontSize: '1.1rem',
                }}
              >
                Rentals
              </a>
            </li>
          </ul>
        </nav>

        <main
          style={{
            flexGrow: 1,
            padding: '2rem',
          }}
        >
          <h2 style={{ color: '#333', marginBottom: '1.5rem' }}>Dashboard</h2>
          <div
            style={{
              display: 'grid',
              gridTemplateColumns: 'repeat(3, 1fr)',
              gap: '2rem',
            }}
          >
            <div
              style={{
                backgroundColor: '#fff',
                padding: '1.5rem',
                borderRadius: '8px',
                boxShadow: '0 2px 8px rgba(0, 0, 0, 0.1)',
              }}
            >
              <h3 style={{ color: '#333', marginBottom: '0.5rem' }}>Total Books</h3>
              <p style={{ color: '#666', fontSize: '2rem', fontWeight: 'bold' }}>
                100
              </p>
            </div>
            <div
              style={{
                backgroundColor: '#fff',
                padding: '1.5rem',
                borderRadius: '8px',
                boxShadow: '0 2px 8px rgba(0, 0, 0, 0.1)',
              }}
            >
              <h3 style={{ color: '#333', marginBottom: '0.5rem' }}>Total Users</h3>
              <p style={{ color: '#666', fontSize: '2rem', fontWeight: 'bold' }}>
                50
              </p>
            </div>
            <div
              style={{
                backgroundColor: '#fff',
                padding: '1.5rem',
                borderRadius: '8px',
                boxShadow: '0 2px 8px rgba(0, 0, 0, 0.1)',
              }}
            >
              <h3 style={{ color: '#333', marginBottom: '0.5rem' }}>Total Rentals</h3>
              <p style={{ color: '#666', fontSize: '2rem', fontWeight: 'bold' }}>
                75
              </p>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
};

export default AdminDashboard;
